            //etiquette
            RockMigrationHelper.AddDefinedValueAttributeValue("1CCF5618-4400-4CE4-90EA-3759C96CB5B8", "6FDB39E9-2ECA-4857-B9A9-17B32C0CD51D", @"<b>Meeting and Greeting</b><br>In India, the customary greeting is called a <i>namaste</i>, and it involves bowing slightly or nodding while holding your palms together below your chin. Handshakes are also used in business, but the <i>namaste</i> is the safest choice because you can use it in situations when you are unsure whether physical contact is appropriate.<br><br><b>Conversation</b><br>Indians are very friendly and gregarious and will start a conversation anywhere and ask all sorts of personal questions; it is okay for you to reciprocate and ask your host similar questions. Discussing your family is perfectly acceptable and will help to build trust.<br><br>Try to be accommodating and flexible at all times; if you express disagreement with someone who doesn’t know you well, you will be viewed as pushy or even hostile and aggressive. Avoid standing with your hands on your hips; this is an aggressive gesture. In conversation, an appeal to emotions and beliefs will produce better results than cool logic.<br><br>If you’re stuck for conversation, talk about cricket, politics (except Pakistan), or movies. Do a little homework on all these subjects before visiting India; a bit of small talk will really break down cultural barriers. Avoid discussing poverty or religion unless you are showing a genuine interest in some aspect of religious observance. Do not insult anyone by confusing or comparing Indians with Pakistanis.<br><br>Indians are very polite so they have great difficulty saying no. Be sensitive to replies that might indicate a gentle negative, such as “We’ll see.” This apparent inability to commit to a negative decision is based on politeness, not deception.<br><br><b>Eating and Drinking</b><br>When someone offers you food or a drink, it is polite to refuse it at least once before accepting. After this, don’t refuse an offer of food or drink because any rejection of hospitality is viewed as an insult. After eating, thanking you hosts is considered an abuse of hospitality because it implies that the food was not offered willingly. Instead, offer a genuine invitation to dine with you in the near future. Don’t be surprised if you guests arrive late and bring uninvited guests. In the West this would be seen as taking liberties, but in India it is a sign that your friends like you enough to encourage others to enjoy your company and hospitality.<br><br>Always wash your hands before and after a meal. Hindus also rinse out their mouths before eating. Eat food with your right hand; the left is reserved for unclean uses such as going to the bathroom.<br><br>Don’t offer anyone else, even a close friend or partner, food from your plate. The Western romantic image of offering a forkful of food to your lover would be viewed with disgust.<br><br>After a meal in a restaurant, you will be served a plate of seeds (usually anise or toasted fennel). Chew them to freshen your breath.<br><br><b>Out and About</b><br>Avoid public displays of affection with members of the opposite sex, including hugging someone to say hello. Many Hindus and Sikhs avoid all physical contact between the sexes, including handshakes. Muslim men must ritually cleanse before prayer if they touch a woman, so women should observe the practice of namaste when in doubt. You never see people kissing and hugging on the streets, although you may spot a little clandestine intimacy at some of the popular tourist sites.<br><br>Always arrive a few minutes late to a social function (unless it’s an official function). Arrive about 15 minutes late to a dinner party.<br><br>When visiting someone’s home, take special care to respect the customs and beliefs of others; your behavior will never be criticized while you are the honored guest.<br><br>The following are rude and should be avoided: winking, whistling, pointing or beckoning with your fingers, touching someone’s ears or pointing your feet at someone. If your feet make contact with anybody else, you should apologize because feet are considered unclean.<br><br><b>Dress</b><br>Since the cow is sacred in India, wearing leather jackets, belts, or watch straps as well as carrying a leather purse may cause offense, especially in a place of worship.<br><br>Dress to cover as much skin as possible. Men and women should keep their shoulders covered. Women should wear baggy clothes that do not emphasize their contours. It is okay for Western women to wear a sari to a special event (such as a wedding); it shows you respect the culture and it will not be viewed as inappropriate as long as you have the confidence to wear it and you have chosen it carefully. (Ask an Indian female friend to help you shop).<br><br><b>Gifts and Tips</b><br>In India, a tip or baksheesh is more about ensuring good service than rewarding it. For example, it might help to get you a seat on a train that is officially full. In a restaurant, a 10 percent tip after the meal is acceptable, but often a service charge is added to the bill.<br><br>If you receive a gift, open it in private. Wrap gifts with bright-colored paper; avoid black and white, which are unlucky. Don’t give leather gifts.<br><br>Tipping a servant is a family home is acceptable, but check with the hosts because if you give the servant too much, it might undermine his or her relationship with the employer; what is loose change to you, may be several weeks’ wages to the servant.");
            RockMigrationHelper.AddDefinedValueAttributeValue("86EC66AB-A255-4172-BD4B-51402394624A", "6FDB39E9-2ECA-4857-B9A9-17B32C0CD51D", @"<b><u>Meeting and Greeting</u></b><br>Initial greetings are quite formal, with handshakes and direct eye contact.  Although Chileans have an initial reserve that is more characteristic of Europe than Latin America, they will warm to you quickly.  Greet the most senior person first, as elders are treated with great respect.  Close male friends may hug and backslap briefly (the Spanish <i>abrazo</i>), while women usually air kiss each other once on the right cheek.  Kiss or shake hands again upon departure.<br>Personal space is small.  Chileans stand close, so don’t back away; they will think you are being shy and quickly close the gap again.  Or worse, they will think you are being unfriendly.<br><br><b><u>Conversation</u></b><br>When saying goodbye, a Chilean acquaintance may say, “I’ll call you later.”  This is just an expression, so don’t sit around waiting for the phone to ring!<br>It is acceptable to interrupt others while they are speaking; in fact, if someone interrupts you it is a sign that they are interested and engaged in what you are saying.<br>Chileans are honest and trustworthy, but their politeness often leads them to give a diplomatic answer instead of the plain truth.<br><br><b><u>Eating and Drinking</u></b><br>Keep your knife and fork in your right and left hands, respectively, at all times; don’t put down your knife to eat with your fork in the United States style.  Keep your hands visible on top of the table, but not your elbows.  Accept what you are given and wait to be offered seconds; don’t ask for more.<br>When toasting someone, look that person in the eye and say <i>“Salud.</i>” Pour wine with your right hand.<br>Always arrive late to a social function (unless it’s an official function).  Arrive at least 15 minutes late to a dinner party.<br>The host always pays the bill in a restaurant, and the bill arrives only after it has been requested.  Women never pay; any attempt to do so may embarrass the host.<br>When smoking, always offer a cigarette to everyone present.<br><br><b><u>Out and About</u></b><br>In some South American countries bribing police is commonplace, but in Chile it will land you in serious trouble.  Do not hesitate to approach the police for assistance; they are helpful and trustworthy.<br>Maintain good posture – no slouching or relaxed poses.  Do not put your hands in your pockets.  Stand when a woman enters the room.  Do not yawn or stretch in public.<br><br><b><u>Dress</u></b><br>Present a clean and elegant image.  Chileans dress with style and sophistication; women should dress modestly and avoid showy jewelry or anything revealing or provocative.  Despite their sartorial elegance, Chileans don’t dress for dinner.<br><br><b><u>Gifts and Tips</u></b><br>When visiting a Chilean home, always arrive with a gift of flowers or candy, as well as something for any children present.<br>In business, women should not give gifts to male colleagues; the gesture might be misinterpreted as a proposition.  Always open gifts immediately.<br>Restaurants often include a 10 percent service charge, but it is customary to add another 10 percent for good service.");
            RockMigrationHelper.AddDefinedValueAttributeValue("95B394D8-FD19-41B9-824F-98A9D51AB34B", "6FDB39E9-2ECA-4857-B9A9-17B32C0CD51D", @"<b><u>Meeting and Greeting</u></b><br>The most usual greeting is a handshake and it is not uncommon for close male friends and family to hug. Generally friends would greet each other with a kiss. <br><br>In villages, strangers in the street will say <i>“Buna ziua”</i> (“good day”), and you should return the greeting.  Communities are close knit, so a villager will assume that you must be staying with someone he or she knows, and therefore you deserve a welcome. <br><br>Romanians often use <i>Domnul</i> (Sir) and <i>Doamna</i> (Madam) before the last name, although the younger generation tends to be on first name terms.  With older people you should use this polite address unless you are invited to switch to first names.<br><br><b><u>Conversation</u></b><br>Few subjects are off limits, so don’t be surprised if you are asked about your age, politics, income, or religious beliefs.<br><br><b><u>Eating and Drinking</u></b><br>Keep your knife and fork in your right and left hands, respectively, at all times; don’t put down your knife to eat with your fork in the United States style.  Keep your hands on the table, but not your elbows.<br><br>Don’t eat your food with your hands. <br><br>During the summer, Romanians often mix their wine with sparkling mineral water (<i>sprit</i>), and the waiter may ask if you would like your wine served this way.  Drinks are served without ice unless it is specially requested.<br><br>To make a toast, say <i>“Noroc”</i> (“Cheers”).  Before eating it is polite to wish your companions <i>“Pofta buna”</i> (“Good appetite”).<br><br>If you decline food, your host may assume you are being polite and serve you anyway, so it is important to distinguish between a polite refusal and a genuine one.<br><br>Drinking any alcohol and driving is illegal.  Beware of driving with a hangover, because there will still be alcohol in your bloodstream.<br><br>Smoke is inescapable, and although the government recently banned smoking in public places, this is often ignored.  Foreign cigarettes are a convenient bargaining tool in remote poorer areas.<br><br><b><u>Out and About</u></b><br>Bathrooms are often marked <i>“Femei”</i> for women and <i>“Barbati”</i> for men.  Violent crime is low relative to the rest of Europe, but petty crime is widespread.  The most common is pick-pocketing, money-changing scams, and con artists posing as “tourist police.”  (There is no such thing.  Say no and walk away; otherwise, they will ask for money or to see your passport.)<br><br>Only use taxis with the approved taxi sign and make sure the fare is listed on the driver’s door. Make sure the meter is turned on when the driver starts driving, <br><br>There are a lot of stray dogs in major cities.  Don’t approach them, and keep well away from any packs. Steer clear of sheep dogs if you are in the mountains.<br><br>When exchanging money, check if they would tax you for it “commission”, but in general it is better to not go by yourself and have a Romanian present. <br><br><b><u>Dress</u></b><br>Smart, casual clothing is adequate for most situations outside of business, although you should dress up more to go to the theater or a restaurant.<br><br><b><u>Gifts and Tips</u></b><br>It is customary to bring a small gift when visiting someone’s home – an odd number of flowers, chocolates, or a bottle of wine.<br><br>You should tip 10 percent in restaurants for good service.");
            RockMigrationHelper.AddDefinedValueAttributeValue("9E076357-9B18-4D6D-878E-7372EE1C2FC5", "6FDB39E9-2ECA-4857-B9A9-17B32C0CD51D", @"<b><u>Meeting and Greeting</u></b><br>Mexicans place much importance on personal and family relationships, so trust and respect, especially in business, are built up by your ability to interact with others, not by your credentials.<br><br>A Mexican handshake is a brisk, firm snap.  Say “Buenos dias/tardes/noches” for “Good morning/afternoon/evening or night” or “Hola, como estas” (Hi, how are you?).<br><br>Friends greet each other with a touch on the elbows or a full-on abrazo, which is a bear hug with much backslapping.  Don’t be surprised if someone gives you a hearty abrazo after only the second meeting.  Mexicans are very friendly.<br><br>Winking and whistling (called the piripo) is quite common between men and women on meeting.  Cheek-kissing is also popular.<br><br>Always use Senor (Mr) and Senora (Mrs) or Senorita (Miss) plus the paternal family name until you are invited to switch to first names.<br><br>Punctuality is very flexible in Mexico.  It is common to arrive half an hour late for social events.  The main adjustment you will have to make will be adapting to the slow pace of life.<br><br><b><u>Conversation</u></b><br>Spanish is the main language, but about a third of the population also (and sometimes exclusively) speaks the indigenous Indian languages of the Aztecs and Maya.  Any attempt to speak Spanish, however inadequate, will be appreciated.<br><br>Familiarize yourself with the concept of manana, which means “tomorrow” and is a habitual response to questions that require a definite answer.  If you want to know when your car will be fixed, it will always be manana.  This can seem like a stalling or laziness, but actually Mexicans are reluctant to disappoint.  If you ask someone for directions, they would rather send you in the wrong direction than offer no help at all.  Maybe can often mean no.<br><br>If you hear someone saying “psst-psst”, they are trying to get your attention; this is not considered rude.<br><br><b><u>Eating and Drinking</u></b><br>When paying in shops and restaurants, always place cash or credit cards into the hand of the person who is serving you.  It is rude to place it on the counter.<br><br><b><u>Out and About</u></b><br>Personal space is small.  Mexicans stand close, so don’t back away; they will think you are being shy and quickly close the gap again.  Or worse, they will think you are being unfriendly.<br>If you are invited to someone’s home, don’t discuss business unless the subject is raised.<br>It is respectful to keep eye contact short and infrequent, especially with your elders.  Holding a stare is confrontational, as is standing with your hands on your hips.<br><br><b><u>Dress</u></b><br>Business dress is conservative, with dark suits for men and smart, feminine skirts and blouses along with nylons and high heels for women.<br><br><b><u>Gifts and Tips</u></b><br>Gift-giving is not an integral part of Mexican business culture, but a small gift is not inappropriate.  However, if a businessman offers a gift to a woman, he should say it is from his sister or his wife to avoid potential embarrassment.<br>Bringing a small gift when you are invited to someone’s house is optional.  Avoid red or yellow flowers (according to Mexican folklore, the former cast spells, the latter signify death); also avoid silverware from another country, as Mexican silver is world-famous.");
            RockMigrationHelper.AddDefinedValueAttributeValue("CFB4AD60-A229-4D2D-9A07-A71DC66B3E22", "6FDB39E9-2ECA-4857-B9A9-17B32C0CD51D", @"<ul><li>Cambodians are not used to bodily contact, especially in public, thus avoid kissing, hugging or <br>back-slapping when meeting a local.  At the same time, be moderate in your actions and speech.<br>Cambodians are not used to bodily contact, especially in public, thus avoid kissing, hugging or <br>back-slapping when meeting a local.  At the same time, be moderate in your actions and speech.<br></li><li>Avoid touching the heads of adults and older children.</li><li>Do not punish children in public.</li><li>Use your right hand for most purposes, such as pointing or eating, but use both hands when passing<br>a business card or similar item to a Cambodian.</li><li>Hand things out to people.  Avoid throwing or tossing things at Cambodians.</li><li>Sit with your legs to one side or in the lotus position; do not show the soles of your feet to a Cambodian and never to a monk or a Buddhist icon.</li><li>When sitting in a chair, it is disrespectful to cross your legs, stretch them in front of you or to lean back.</li><li>Gifts need not be expensive buy should be attractively wrapped.</li><li>Dress conservatively especially in rural villages and at religious shrines.</li><li>Ask permission first before taking pictures of monks, temples and religious objects.</li><li>Do not shoot video of hill tribe areas</li><li>Don’t lose your cool.  Loss of temper, indication loss of control, is the most effective way to lose face in Cambodia.</li><li>It is dangerous to flaunt your possessions as in opening a wallet full of credit cards.</li><li>Speak slowly and clearly.</li><li>Respect all aspects of the Buddhist faith and the elderly.</li></ul>");
            RockMigrationHelper.AddDefinedValueAttributeValue("DCB69545-04E7-4F1F-A1D2-A2082735E620","6FDB39E9-2ECA-4857-B9A9-17B32C0CD51D",@"<b><u>Meeting and Greeting</b></u><br>Greet with a firm handshake and maintain good eye contact upon arrival and departure, and say <i>“Czesc”</i> (“Hello”) or <i>“Do widzenia”</i> (Goodbye”).  Women and close friends greet each other with kisses.  Older Polish men might kiss a woman’s hand.<br><br>First names are reserved for family and close friends.  Otherwise, you should use the last name, preceded by <i>“Pan”</i> (for men) or <i>“Pani”</i> (for women, regardless of marital status).  If you are invited to use first names, it is still common to use these prefixes.<br><br><b><u>Conversation</b></u><br>Personal and family relationships are everything, so outsiders will be expected to prove themselves to build trust and respect by conforming to the formal culture and conducting themselves with dignity and moral fiber.<br><br><b><u>Eating and Drinking</b></u><br>Tea is very popular in Poland.  Some older Poles sip their tea through a sugar cube held between their front teeth.");
            RockMigrationHelper.AddDefinedValueAttributeValue("E42C2710-B782-49FF-97A0-BBC81D576EC1","6FDB39E9-2ECA-4857-B9A9-17B32C0CD51D",@"<b><u>Meeting and Greeting</u></b><br>A greeting rarely includes a handshake. The Chinese bow or nod their heads, often without a smile, as greeting is a solemn, respectful affair.  If you do shake hands, do not expect to receive a firm handshake.<br>Punctuality is very important, especially in business.  If you are with a group, arrive together.<br>Offer a business card with both hands and with the text facing away from you. When receiving a business card, it is polite to scrutinize it closely and then keep holding the card, rather than stuffing it into your pocket (which is rude and also signifies the end of the meeting).<br><br><b><u>Conversation</u></b><br>If someone doesn’t understand what you are saying, you may be met with a silent smile.  Keep gestures to a minimum.  The Chinese use very few gestures when speaking and may find them distracting and irritating.<br>Saying no is hard for a Chinese person, who will prefer to say something like “perhaps” or “I’ll think about it” in order to be polite.  Expect to be let down very gently, since the Chinese are very diplomatic and will go out of their way to save face.  If you need to discuss a sensitive subject, do so in private so you don’t show someone up in public.  Causing someone to lose face would be a disaster, not only for your relationship, but for that person’s whole family.<br><br><b><u>Eating and Drinking </u></b><br>Meals usually take place in restaurants rather than in private houses.  Guests are usually seated according to rank, with the guests of honor seated to the right of the host.  Do not start eating until the host has served the principal guest.  Don’t talk business during a meal.<br>Alcohol is practically obligatory, and your host will view it as his duty to get you drunk.  Don’t try to drink your Chinese hosts under the table; your desire to avoid losing face will never be as great as theirs.<br>Expect much toasting.  The host utters the first toast with the words “Gan bei,” which means “dry the glass,” after which everyone should drain their glasses.  Try to maintain eye contact while drinking a toast.<br>Only pour yourself a drink after you have first topped off the glasses of those around you.  It is polite to fill a glass as full as possible without actually spilling any liquid, as a sign of generosity and companionship.<br>Use the thick end of your chopsticks when taking food from a communal dish.  Refusing food or drink is impolite, but don’t dig around in a bowl looking for the best bits of food.  Finish your rice or noodles as a sign of respect for the person who prepared the food, but leave a small amount of other food untouched to indicate that you are satisfied. <br>Eat rice by holding the bowl close to your face and scooping it into your mouth with your chopsticks.  Leaving the bowl on the table is a sign that you are unhappy with the food.  Never leave your chopsticks stuck in your rice; this is associated with death.<br>Slurping noodles or soup is an acceptable way of cooling it down.<br>Many restaurants will invite you to choose your own food, especially seafood, which is culled on the spot to ensure freshness.<br><br><b><u>Out and About</u></b><br>Haggle for everything.  You will stand out as a tourist, so the starting price for anything will inevitably be high.<br>Spitting is a national obsession, although the Chinese government recently banned it to curb the spread of severe acute respiratory syndrome (SARS).  Chinese people often spit for good luck, especially when they see foreigners.  The roots of this tradition lie in the ancient belief that demons reside and breed in mucus, so don’t be surprised if you encounter lots of people purging their throats in your direction.<br>The concept of standing in line is not popular in China, except in banks and airports; usually, it is a free-for-all with much pushing and shoving.<br>Carry a supply of tissues.  Bathroom facilities in all but the best hotels are very basic - usually a hole in the ground with coarse toilet paper and even stalls without doors.<br>As a foreigner you will attract a lot of friendly curiosity and may actually draw crowds if you stand still for too long.  If you are blonde, people will wish to touch your hair continually.  Take it as a compliment.  Rickshaws and bicycles do not stop at traffic lights, so watch out when you’re crossing the road.<br><br><b><u>Dress</u></b><br>Wear smart, casual clothes, but nothing too revealing.<br><br><b><u>Gifts and Tips</u></b><br>Chinese people will politely decline a gift three times before accepting it.  They will not open it in front of you, and nor should you.<br>Foreign cigarettes, wine, and spirits make good presents, but don’t give flowers, white objects, or clocks, which all are associated with death.<br>Tipping is officially illegal, although it does happen.  Often an offered tip will be politely refused and may cause embarrassment.");
            RockMigrationHelper.AddDefinedValueAttributeValue("F4DAEB01-A0E5-426A-A425-7F6D21DF1CE7","6FDB39E9-2ECA-4857-B9A9-17B32C0CD51D",@"<b><u>Meeting and Greeting</u></b><br>When you meet someone for the first time, you:<br>Stand up, smile and make eye contact<br>Shake hands firmly.<br>Say “My name is _______. Nice to meet you.”<br>Hugging is common with family and friends<br>It is important to remember people’s names.<br><br><b><u>Conversation</u></b><br><b><i>“Yes” means Yes and “No” means No</i></b><br>If you do not understand something, it is usually better to admit it immediately.  This is true 				especially when it impacts safety at work.<br>If you tell people you will go to a social event, they expect you to go.  It is okay to say “thank you for  the invitation, but I am not able to attend.”  People can get upset if you say “yes” but you do not go.<br>If a person offers you help and you say “no”, they may not offer again.<br><br><b><u>Small Talk</u></b><br>Small talk is starting conversations about things such as the weather, sports, movies, television, 				shopping, etc.  It can also include topics like your family or your perceptions of the U.S.<br>Small talk can be a way to lead to deeper conversation.<br><br><b><u>Humor</u></b><br>Humor can start conversations or relax situation.<br>Sarcasm is common, where people say the opposite of what they mean.  For example, a person can say 		“Wow, it’s really hot outside!” when the weather is very cold.<br>Some people use sarcasm when they are upset, and some use it to be funny.<br>Do not use humor about race, gender, homosexuality, disabilities or religion.<br><br><b><u>Personal Space and Volume</u></b><br>In the U.S. the physical space between you and the person you are interacting with is usually at least 			on full arm’s length.<br>Some people do not like when other people speak very loud.  People may think you are angry when 			you talk loud.<br><br><b><u>Cleanliness</u></b><br>People usually:<br>Take a shower or bath every day.<br>Brush their teeth two or three times a day.<br>Use deodorant.<br>Many people are uncomfortable with strong body odors, bad breath, chewing gum loudly, and spitting 			or belching in public.<br>Littering, or throwing garbage or trash in the wrong place outside of your home, is illegal. Put trash and 		waste in the correct containers.<br>The plumbing system in the U.S. is reliable.  Toilet paper is flushed in the toilet, not thrown in the trash 			can.  Do not put anything that is not toilet paper in the toilet.<br><br><b><u>Common Social Taboos</u></b><br>There is some information that people like to keep private.  Do not ask people you don’t know very well about their:<br>Opinions about politics<br>Salary or how much they make<br>Sexual orientation and practices<br>Religious beliefs<br>Age or weight<br>Do not stare or point at people.<br>Do not use bad language in front of children and other who might not approve.<br>In general it is good to smile, open doors for others, and say “please” and “thank you”.<br><br><b><u>Political Correctness</b></u><table><tr><th><i>Politically Correct</i></th><br><th><i>Politically incorrect or offensive</i></th></tr><tr><td>African-American/Black</td><td>Negro, Colored</td></tr><tr><td>Gay/Homosexual</td><td>Homo</td></tr><tr><td>Asian</td><td>Oriental</td></tr><tr><td>Elderly/Senior</td><td>Old, Ancient</td></tr><tr><td>Mentally or physically challenged</td><td>Handicapped, Retarded</td></tr></table>");
            RockMigrationHelper.AddDefinedValueAttributeValue("F5BA2CCD-6F51-4D10-A50E-CC8BAE0E4754","6FDB39E9-2ECA-4857-B9A9-17B32C0CD51D",@"<ul><br><li>Say Bonjou and Bonswa to everyone you pass!  Friendliness matters</li><br><li>Arms folded across your chest are a sign of respect.</li><br><li>Not looking someone in the eye is honoring-especially children to adults.</li><br><li>Storms and rain and lightning and wind are fun to us, but they bring danger and discomfort and death to many Haitians who don''t have solid housing.</li><br><li>Word humor, subtlety, sarcasm, irony etc are not usually funny to Haitians.</li><br><li>Single white women are a ticket to America, so don''t be too flattered.  You are wonderful, but be cautious.</li><br><li>Haitians are fun! They love to dance and play and talk and laugh. Your connections to them are meaningful. If you aren''t going to keep up a relationship, please don''t say you will.</li><br><li>Saving face is important, so be careful where you confront, complain, or even ask certain questions.</li><br><li>Be careful to show respect and honor.</li><br><li>Haitians love to be clean and neat. Wearing your best to church is honoring.</li><br><li>Modesty is respectful. White girls are shocking and confusing when they wear short shorts, short skirts or low tops. Is this girl rude, promiscuous, not a Christian?</li><br><li>When you give something to someone who asks, you are training them to ask every visitor. Proceed prayerfully.</li><br><li>Life is valued differently. If they got dialed up over every emergency, crisis and tragedy they would all have heart attacks by age 15. They love and care passionately, but have different life experiences that lead to different reactions.</li><br><li>Rocks, dust, garbage are part of life. Many Haitians don''t have latrines or bathrooms. There is no infrastructure.</li><br><li>Food is important, expensive, hard work to prepare and it is a privilege to eat. Thank your cooks and eat your meal with gratitude. Help clean up by clearing and doing dishes.</li><br><li>Practice saying \""""no\"""" graciously. But be prepared to bless by buying a bracelet, painting, sponsor a child, etc as God leads.  For big things go through HCM and your trip leader.</li><br><li>Voodoo is real.  Do not give dolls or stuffed animals as gifts. </li><br><li>If you don''t get an answer to a question, it could be because they don''t want to say no or tell you something you don''t want to hear.  They could be saving face if they don''t know the answer. Proceed with caution.</li> <br></ul>");
            RockMigrationHelper.AddDefinedValueAttributeValue("FA4E5949-1945-40F3-BB81-13B1BD213E26","6FDB39E9-2ECA-4857-B9A9-17B32C0CD51D",@"<b><u>Meeting and Greeting</b></u><br>Punctuality is fairly flexible.  If you are a newcomer to Greece, try to arrive on time, but be prepared to wait for your Greek counterparts.  Social events often begin up to an hour late and are open-ended. <br><br>Greet with a firm handshake and direct eye contact.  When you know someone better you may embrace or kiss on both cheeks.  You will typically be introduced to older people first (they are greatly respected in this culture), followed by men and women.  Shake hands again with everyone in the group upon departure. <br><br>Titles are very important and respectful:  Use Keereeoss (Mr.) and Keereeah (Mrs.) plus the family name (rather than first names).<br><br><b><u>Conversation</b></u><br>Greeks are very friendly and gregarious and will talk very openly about themselves and ask all sorts of personal questions.  It is okay for you to reciprocate and ask your host similar questions.  Anger isn’t always expressed directly; it might be vented with an ironic smile or a laugh.<br><br><b><u>Eating and Drinking</b></u><br>The drinking age in Greece is 16.<br><br>In many restaurants you are allowed (and even encouraged) to visit the kitchen to see how the food is being prepared and to decide what you would like to order. “Tea eeneh aftoe?” means “What is this?”<br><br>Groups of diners often order many communal dishes, which are placed on the table for everyone to help themselves.  If you want more food, you may order it at any time during the meal, rather than only at the beginning.  Greek waiters will leave you to enjoy your meal without continually returning to check that everything is okay.  It is up to you to attract the waiter’s attention if you need service.<br><br>In a Greek home, expect to be offered many seconds and thirds at meals.  Eating well is a compliment to your hosts.  If you are dining out, your host will usually pay the whole bill.<br><br>The most common toast is “Kalymata” (“Good health”).<br><br>Greeks never rush their coffee; it is savored for at least half an hour.  Frappe (chilled coffee) is very popular.<br><br><b><u>Out and About</b></u><br>When entering a shop or taverna, always acknowledge the owner with a “Kalimera” (“Good day”) or “Kalispera” (Good evening”).<br><br><b>Raising an open palm at face level is insulting.  The OK sign is considered a rude gesture with obscene connotations.</b><br><br>Greeks say no with an upward nod and yes by tilting the head from side to side. More confusing still, the Greek for yes is Nai and no is Oci.<br><br>If you compliment someone, you may see them puff breath through their lips.  This gesture wards off jealousy of the “evil eye.”  (Greeks are very superstitious.)<br><br>Greek men everywhere enjoy playing Tavli (backgammon), often very loudly and with good-natured taunting and banter.<br><br>In most toilets, paper goes in a special bin instead of being flushed away, to avoid blocking the pipes.<br><br><b><u>Dress</b></u><br>Business dress is conservative and formal, even during the summer; otherwise, dress is casual and comfortable, simple and elegant.<br><br><b><u>Gifts and Tips</b></u><br>Greek people are very generous.  Don’t make a big display of admiring an object or an ornament, or your host may feel obliged to give it to you.<br><br>When you are invited to a Greek home, make a big fuss over the children.  Greece is a very child-oriented culture, so don’t exclude them when talking to the adults.<br><br>Most restaurants add 15 percent service charge, and you may add a small tip for the waiter on the tray.  In restaurants, the table clearers may be the proprietor’s children, so leave some change on the table as well.");
                     
